import { useEffect } from 'react';
import { appTitle } from '../globals/globals';



function PageAbout() {

    useEffect(() => {
        document.title = `${appTitle} - About`;
    }, []);

    return (
        <section className="about-page">
            <h2>About Us</h2>
        </section>
    )
}

export default PageAbout;
